import building from './images/tall-building.jpg';
import hare from './images/hare.jpg';
import dinning from './images/dinning-and-kitchen.jpg';
import Contact from "./Contact";
import vase from './images/superb-vase.jpg';

export default function App() {
  return (
    <div className='contact-container'>
      <Contact image={ building } number='09098113614' email='powellleroy488@gmail.com' name='Le Roy'/>
      <Contact image={ hare } number='08085659078' email='jessiepowell779@gmail.com' name='Jessie'/>
      <Contact image={ dinning } number='09138261476' email='harrywealth@gmail.com' name='Harry'/>
      <Contact image={ vase } number='07032624578' email='victoroshimua@gmail.com'/>
    </div>
  );
};
